static inline __attribute__((always_inline, unused)) __attribute__((no_instrument_function)) int cpufreq_table_find_index_al(struct cpufreq_policy *policy,
           unsigned int target_freq)
{
 struct cpufreq_frequency_table *table = policy->freq_table;
 struct cpufreq_frequency_table *pos, *best = table - 1;
 unsigned int freq;

 for (pos = table; pos->frequency != ~1u; pos++) if (pos->frequency == ~0u) continue; else {
  freq = pos->frequency;

  if (freq >= target_freq)
   return pos - table;

  best = pos;
 }

 return best - table;
}


