extern inline __attribute__((always_inline, unused)) __attribute__((no_instrument_function)) int is_multicast_mac_addr(const u8 *addr)
{
 return (addr[0] != 0xff) && (0x01 & addr[0]);
}

extern inline __attribute__((always_inline, unused)) __attribute__((no_instrument_function)) int is_broadcast_mac_addr(const u8 *addr)
{
 return ((addr[0] == 0xff) && (addr[1] == 0xff) && (addr[2] == 0xff) &&
  (addr[3] == 0xff) && (addr[4] == 0xff) && (addr[5] == 0xff));
}

extern inline __attribute__((always_inline, unused)) __attribute__((no_instrument_function)) int is_zero_mac_addr(const u8 *addr)
{
 return ((addr[0] == 0x00) && (addr[1] == 0x00) && (addr[2] == 0x00) &&
  (addr[3] == 0x00) && (addr[4] == 0x00) && (addr[5] == 0x00));
}





