inline __attribute__((always_inline, unused)) __attribute__((no_instrument_function)) static u8 *get_rxmem(union recv_frame *precvframe)
{

 if (precvframe == ((void *)0))
  return ((void *)0);

 return precvframe->u.hdr.rx_head;
}

inline __attribute__((always_inline, unused)) __attribute__((no_instrument_function)) static u8 *get_rx_status(union recv_frame *precvframe)
{

 return get_rxmem(precvframe);

}

inline __attribute__((always_inline, unused)) __attribute__((no_instrument_function)) static u8 *get_recvframe_data(union recv_frame *precvframe)
{


 if (precvframe == ((void *)0))
  return ((void *)0);

 return precvframe->u.hdr.rx_data;

}

inline __attribute__((always_inline, unused)) __attribute__((no_instrument_function)) static u8 *recvframe_push(union recv_frame *precvframe, sint sz)
{
 if (precvframe == ((void *)0))
  return ((void *)0);


 precvframe->u.hdr.rx_data -= sz ;
 if (precvframe->u.hdr.rx_data < precvframe->u.hdr.rx_head) {
  precvframe->u.hdr.rx_data += sz ;
  return ((void *)0);
 }

 precvframe->u.hdr.len += sz;

 return precvframe->u.hdr.rx_data;

}


inline __attribute__((always_inline, unused)) __attribute__((no_instrument_function)) static u8 *recvframe_pull(union recv_frame *precvframe, sint sz)
{





 if (precvframe == ((void *)0))
  return ((void *)0);


 precvframe->u.hdr.rx_data += sz;

 if (precvframe->u.hdr.rx_data > precvframe->u.hdr.rx_tail) {
  precvframe->u.hdr.rx_data -= sz;
  return ((void *)0);
 }

 precvframe->u.hdr.len -= sz;

 return precvframe->u.hdr.rx_data;

}

inline __attribute__((always_inline, unused)) __attribute__((no_instrument_function)) static u8 *recvframe_put(union recv_frame *precvframe, sint sz)
{




 unsigned char *prev_rx_tail;



 if (precvframe == ((void *)0))
  return ((void *)0);

 prev_rx_tail = precvframe->u.hdr.rx_tail;

 precvframe->u.hdr.rx_tail += sz;

 if (precvframe->u.hdr.rx_tail > precvframe->u.hdr.rx_end) {
  precvframe->u.hdr.rx_tail -= sz;
  return ((void *)0);
 }

 precvframe->u.hdr.len += sz;

 return precvframe->u.hdr.rx_tail;

}



inline __attribute__((always_inline, unused)) __attribute__((no_instrument_function)) static u8 *recvframe_pull_tail(union recv_frame *precvframe, sint sz)
{





 if (precvframe == ((void *)0))
  return ((void *)0);

 precvframe->u.hdr.rx_tail -= sz;

 if (precvframe->u.hdr.rx_tail < precvframe->u.hdr.rx_data) {
  precvframe->u.hdr.rx_tail += sz;
  return ((void *)0);
 }

 precvframe->u.hdr.len -= sz;

 return precvframe->u.hdr.rx_tail;

}



