inline __attribute__((always_inline, unused)) __attribute__((no_instrument_function)) static u8 *get_bssid(struct mlme_priv *pmlmepriv)
{


 return pmlmepriv->cur_network.network.MacAddress;
}

inline __attribute__((always_inline, unused)) __attribute__((no_instrument_function)) static sint check_fwstate(struct mlme_priv *pmlmepriv, sint state)
{
 if ((state == 0x00000000) &&
  (pmlmepriv->fw_state == 0x00000000))
  return 1;

 if (pmlmepriv->fw_state & state)
  return 1;

 return 0;
}

inline __attribute__((always_inline, unused)) __attribute__((no_instrument_function)) static sint get_fwstate(struct mlme_priv *pmlmepriv)
{
 return pmlmepriv->fw_state;
}
extern void rtw_mi_update_iface_status(struct mlme_priv *pmlmepriv, sint state);

static inline __attribute__((always_inline, unused)) __attribute__((no_instrument_function)) void set_fwstate(struct mlme_priv *pmlmepriv, sint state)
{
 pmlmepriv->fw_state |= state;
 rtw_mi_update_iface_status(pmlmepriv, state);
}
static inline __attribute__((always_inline, unused)) __attribute__((no_instrument_function)) void init_fwstate(struct mlme_priv *pmlmepriv, sint state)
{
 pmlmepriv->fw_state = state;
 rtw_mi_update_iface_status(pmlmepriv, state);
}

static inline __attribute__((always_inline, unused)) __attribute__((no_instrument_function)) void _clr_fwstate_(struct mlme_priv *pmlmepriv, sint state)
{
 pmlmepriv->fw_state &= ~state;
 rtw_mi_update_iface_status(pmlmepriv, state);
}





static inline __attribute__((always_inline, unused)) __attribute__((no_instrument_function)) void clr_fwstate(struct mlme_priv *pmlmepriv, sint state)
{
 _irqL irqL;

 _enter_critical_bh(&pmlmepriv->lock, &irqL);
 _clr_fwstate_(pmlmepriv, state);
 _exit_critical_bh(&pmlmepriv->lock, &irqL);
}

static inline __attribute__((always_inline, unused)) __attribute__((no_instrument_function)) void up_scanned_network(struct mlme_priv *pmlmepriv)
{
 _irqL irqL;

 _enter_critical_bh(&pmlmepriv->lock, &irqL);
 pmlmepriv->num_of_scanned++;
 _exit_critical_bh(&pmlmepriv->lock, &irqL);
}
