inline __attribute__((always_inline, unused)) __attribute__((no_instrument_function)) static u32 wifi_mac_hash(const u8 *mac)
{
 u32 x;

 x = mac[0];
 x = (x << 2) ^ mac[1];
 x = (x << 2) ^ mac[2];
 x = (x << 2) ^ mac[3];
 x = (x << 2) ^ mac[4];
 x = (x << 2) ^ mac[5];

 x ^= x >> 8;
 x = x & (32 - 1);

 return x;
}


