static inline __attribute__((always_inline, unused)) __attribute__((no_instrument_function)) int sunxi_gpio_to_name(int gpio, char *name)
{
 int bank, index;

 if (!name)
  return -22;

 if ((gpio >= 1024)) {

  index = gpio - 1024;
  sprintf(name, "GPIO%d", index);
 } else {

  bank = gpio / 32;
  index = gpio % 32;
  sprintf(name, "P%c%d", ('A' + bank), index);
 }

 return 0;
}
